import "./navbar.scss"
import SearchOutlinedIcon from "@mui/icons-material/SearchOutlinedIcon";

const Navbar = () => {
  return (
    <div className="navbar">
      <div className="wrapper">
        <div className="search">
          <input type="text" placeholder="Search..." />
          <SearchOutlinedIcon />
        </div>
      </div>
    </div>
  )
}

export default Navbar
